import React, { Component } from "react";
// import SecureCallService from "./patientaxios";
// import '../patient/add.css'
import { Navbar } from "react-bootstrap";
class Addproduct extends Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (
      <>
      <div align='right'>
       <Navbar style={{background:'black',width:1089 ,height:60}} ></Navbar>
       <br/>
      <div class="card" style={{width:1089}} >
        <form style={{width:1089}}>
               <h3 align='center'>Register New Patient </h3> 
               <div>
               <label>Patient Id</label>
               <input type='text' placeholder='Patient Id'></input>
               </div>
               <div>
               <label>Patient Name</label>
               <input type='text' placeholder='Patient Name'></input>
               </div>
               <div>
               <label>Patient Address</label>
               <input type='text' placeholder='Patient Address'></input>
               </div>
               <div>
               <label>Patient City</label>
               <input type='text' placeholder='Patient City'></input>
               </div>
               <div>
               <label>Patient Id</label>
               <input type='text' placeholder='Patient Id'></input>
               </div>
               <div>
               <label>Patient Age</label>
               <input type='date' placeholder='Patient Age'></input>
               </div>
               <div>
               <label>Patient Gender</label>
               <select>
                 <option value="Male">Male</option>
                 <option value="Female">Female</option>
               </select>
               {/* <input type='select' placeholder='Patient Gender'></input> */}
               </div>

              
          </form>
      </div>
      </div>
      </>

    );
  }
}

export default Addproduct;
